  // adapted from http://stackoverflow.com/a/8888498
  var utc_to_edt_am_pm = function(utc_date) {
    edt_date = new Date(Number(utc_date) - 1000 * 60 * 60 * 4);
    var hours = edt_date.getUTCHours();
    var minutes = edt_date.getUTCMinutes();
    var ampm = hours >= 12 ? 'PM' : 'AM';
    hours = hours % 12;
    hours = hours ? hours : 12;
    minutes = minutes < 10 ? '0' + minutes : minutes;
    return hours + ':' + minutes + ' ' + ampm + ' EDT';
  };

  var mobile_device = false;
  var torque_initialized = false;

  var toggle_torque_and_youtube = function() {
    $(".citibike-torque-wrapper").toggle();
    $(".citibike-youtube-player").toggle();
  }

  var init_torque = function() {
    torque_initialized = true;

    if (window.innerHeight && window.innerHeight > 900) {
      $("#citibike-torque").css("height", 900);
    } else if (mobile_device && window.innerHeight) {
      $("#citibike-torque").css("height", window.innerHeight - 40);
    }

    $(".citibike-youtube-player").hide();
    $(".citibike-torque-wrapper").show();

    var bounds = L.latLngBounds(
      L.latLng(40.54, -74.16),
      L.latLng(40.9, -73.82)
    );

    var tile_layer = L.tileLayer('http://{s}.basemaps.cartocdn.com/light_all/{z}/{x}/{y}.png', {
      attribution: '&copy; <a href="http://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors, &copy; <a href="http://cartodb.com/attributions">CartoDB</a>'
    });

    var map_opts = {
      zoom: 13,
      minZoom: 13,
      maxZoom: 14,
      zoomControl: true,
      scrollWheelZoom: false,
      touchZoom: false,
      maxBounds: bounds,
      layers: [tile_layer]
    };

    if (mobile_device) {
      map_opts.center = [40.734, -73.99];
    } else {
      map_opts.center = [40.734, -73.97];
    }

    var map = new L.Map('citibike-torque', map_opts);

    for (var i = 0; i < station_coordinates.length; i++) {
      var item = station_coordinates[i];
      L.circle([item.latitude, item.longitude], 1, {
        color: '#ffa500',
        stroke: true,
        fillOpacity: 0.9,
        clickable: false
      }).addTo(map);
    }

    var CARTOCSS = [
      'Map {',
      '-torque-time-attribute: "observed_at";',
      '-torque-aggregation-function: "count(id)";',
      '-torque-frame-count: 2700;',
      '-torque-animation-duration: 120;',
      '-torque-resolution: 2;',
      '-torque-data-aggregation: linear;',
      '}',

      '#citibike-torque {',
      'comp-op: lighter;',
      'marker-type: ellipse;',
      'marker-width: 3;',
      'marker-fill-opacity: 0.6;',
      'marker-fill: #2167AB;',
      '}'
    ].join('\n');

    var torque_layer = new L.TorqueLayer({
      //tileJSON: "http://muppal.com/Documentsd/tilejson.json",
      tileJSON: "http://toddwschneider.com/data/torque/citibike_2015_09_16_r2/tilejson.json",
      cartocss: CARTOCSS
    });

    torque_layer.error(function(err) {
      for(error in err) {
        console.warn(err[error]);
      }

      $(".citibike-youtube-player").hide();
      $(".citibike-torque-wrapper").show();
    });

    torque_layer.addTo(map);
    torque_layer.play();
    $(".citibike-torque-pause").addClass("playing");
    var $slider = $(".citibike-torque-slider");

    $slider.slider({
      min: 0,
      max: torque_layer.options.steps,
      value: 0,
      step: 1,
      slide: function(event, ui) {
        var step = ui.value;
        torque_layer.setStep(step);
      }
    });

    torque_layer.on('change:time', function(changes) {
      $slider.slider({value: changes.step});
      $(".citibike-torque-time").text(utc_to_edt_am_pm(changes.time));

      var in_use_count = bike_counts[changes.step];
      
    });

    $(".citibike-torque-pause").on("click", function() {
      torque_layer.toggle();
      $(this).toggleClass("playing");
    });
  };

    init_torque();
